import React from 'react'
import img1 from '../img/icon-scissors.svg'
import img2 from '../img/icon-paper.svg'
import img3 from '../img/icon-rock.svg'

class Corps extends React.Component {
    
    render() { 
        return (
            <div className="bgCorps ">
                <div className="row">
                    <div className="col-6">
                        button <img className="tailleImg1 " src={img1} alt="" />
                    </div>
                    <div className="col-6">
                        button <img className="tailleImg" src={img2} alt="" />

                    </div>
                </div>
                <div className="text-center">
                       button  <img className="tailleImg" src={img3} alt="" />

                </div>
            </div>
            
        );
    }
}

export default Corps;
